import React from 'react';
import './App.css';

//import utils

//react-router-dom
import {
  BrowserRouter,
  Switch,
  Route
} from "react-router-dom";

//component importer
import Header from './component/Header/index';

//global store
////init
import {connect} from 'react-redux';
import {MainState} from './store/index';

////type importer
import {AppState} from './store/App/type';

////action importer
import {setExpanded} from './store/App/action';

interface Props{
  AppState: AppState,
  setExpanded: typeof setExpanded
}

type State = typeof initState;

const initState = {
  string: "Hello my friend" as string
}

class App extends React.Component<Props,State>{
  state= initState;


  renderSwitch = () => {
    return  <Switch>
              <Route exact path="/" children={<div>/</div>} />
              <Route path="/about-us" children={<div>/about-us</div>} />
              <Route path="/documents" children={<div>/documents</div>} />
              <Route path="/git" children={<div>/git</div>} />
            </Switch>
  }

  renderMain = () => {
    return  <React.Fragment>
              <div className="App" children={<Header/>} />
              {/* {this.renderSwitch()} */}
            </React.Fragment>
  }

  render(){
    return <BrowserRouter>
            {this.renderMain()}
          </BrowserRouter>
  }
}

const mapStateToProps = (state:MainState)=> ({
	AppState: state.AppState
});

export default connect(mapStateToProps,{setExpanded})(App);
